import React from 'react';
import './Header.css';

const Header = ({ onShowLogin, onShowRegister }) => {
  return (
    <header className="header">
      <nav className="nav">
        <div className="nav-brand">
          <h2>EthioSoft Marketplace</h2>
        </div>
        <div className="nav-actions">
          <button onClick={onShowLogin} className="nav-btn login-btn">Sign In</button>
          <button onClick={onShowRegister} className="nav-btn register-btn">Get Started</button>
        </div>
      </nav>
    </header>
  );
};

export default Header;
